impl Solution {
    pub fn minimum_index(nums: Vec<i32>) -> i32 {
        let mut freq = std::collections::HashMap::new();
        let n = nums.len();
        for &num in &nums {
            *freq.entry(num).or_insert(0) += 1;
        }

        let (&dominant, &count) = freq.iter().find(|&(_, &count)| count * 2 > n as i32).unwrap();
        let mut prefix_count = 0;
        for i in 0..n-1 {
            if nums[i] == dominant {
                prefix_count += 1;
            }
            let suffix_count = count - prefix_count;
            if prefix_count * 2 > (i + 1) as i32 && suffix_count * 2 > (n - i - 1) as i32 {
                return i as i32;
            }
        }
        -1
    }
}
